import React from "react";

//FUNCTION BASE
var menuMakanan = (nama, harga) => {
  return (
    <div style={{ border: "1px solid black", width: 300, margin: "auto" }}>
      <p>Nama Menu : {nama}</p>
      <p>Harga : Rp. {harga}</p>
    </div>
  );
};

export default menuMakanan;
